import React, {Component} from 'react';

class ResultsTable extends Component {

    render() {
        const {result} = this.props;
        return (
            <div>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Artiste</th>
                        <th>Titre</th>
                        <th>Album</th>
                        <th>Voir plus</th>
                    </tr>
                </thead>
                <tbody>
                    {result}
                </tbody>
            </div>
        )
    }
}

export default ResultsTable;
